import { IconFileText, IconBomb, IconWall, IconApple } from '@tabler/icons-react';
import { useState } from "react";
import OpeningFile from './Files/OpeningFile.jsx';
import Snake from './Files/Snake.jsx';
import MineSweeper from './Files/MineSweeper.jsx';
import the2048 from './Files/2048.jsx';
import FileIcon from './Icons/FileIcon.jsx';

function IconColumn() {
    const [highlight, setHighlight] = useState(null);

    return (
        <div className="grid grid-cols-2 w-32 pt-5 gap-30 pl-20">
            <div>
                <FileIcon highlight={highlight} setHighlight={setHighlight} Icon={IconApple} Component={Snake} name="Snake"/>
                <FileIcon highlight={highlight} setHighlight={setHighlight} Icon={IconBomb} Component={MineSweeper} name="MineSweeper"/>
                <FileIcon highlight={highlight} setHighlight={setHighlight} Icon={IconWall} Component={the2048} name="2048"/>
            </div>
            <div>
                <FileIcon highlight={highlight} setHighlight={setHighlight} Icon={IconFileText} Component={OpeningFile} name="Opening.txt" onLoad={true}/>
                <FileIcon highlight={highlight} setHighlight={setHighlight} Icon={IconFileText} Component={null} name="Resume.txt"/>
            </div>
        </div>
    )
}

export default IconColumn;
